import React from 'react'

const Header = ({bgcolor,clr}) => {
    const headerStyle={
        backgroundColor: bgcolor,
        color: clr,
    };
    console.log({headerStyle})
  return (
    <>
    <div className="container">
        <h2 style = {headerStyle}>FEEDBACK UI</h2>
    </div>
    </>
  );
}

Header.defaultProps  = {
    bgcolor: "green",
    clr: "red",
}

export default Header;






